import React from "react";
import { Link } from "react-router-dom";
import ShowPage from "../components/showRecentDataPage";


const Add = () => {
  return (
    <div>
      <h1>Data Page</h1>
      <Link to="/main">
        <button>Data Page</button>
      </Link>
      <ShowPage/>
    </div>
    
  );
};

export default Add;
